import React from 'react';
import { Link } from 'react-router-dom';

function Footer(props) {
    return (
        <footer className="site-footer">
            <div className="container">
                <div className="row">   
                    <div className="col-6 col-sm-3 text-center">
                        <h5>Social</h5>
                        <a className="btn btn-social-icon btn-instagram" href="http://instagram.com/"><i className="fa fa-instagram" /></a>{' '}
                        <a className="btn btn-social-icon btn-facebook" href="http://www.facebook.com/"><i className="fa fa-facebook" /></a>{' '}
                        <a className="btn btn-social-icon btn-twitter" href="http://twitter.com/"><i className="fa fa-twitter" /></a>{' '}
                        <a className="btn btn-social-icon btn-google" href="http://youtube.com/"><i className="fa fa-youtube" /></a> 
                    </div>          
                    <div className="col-4 col-sm-2 offset-1">
                        <h5>Links</h5>
                        <ul className="list-unstyled">
                            <li><Link to='/home'>Home</Link></li>
                            <li><a href="#">About Us</a></li>

                            <li><a href="#">Create Account</a></li>
                            <li><a href="https://www.google.com/maps/@33.1150912,-96.6531225,15z?hl=en">Find Store</a></li>
                        </ul>
                    </div>

                    <div className="col-sm-4 text-center">
                        <a role="button" className="btn btn-link" href="tel:+2222222222"><i className="fa fa-phone" /> 1-222-222-2222</a><br />
                        <a role="button" className="btn btn-link" href="mailto:shooraki.shirin@gmail.co"><i className="fa fa-envelope-o" /> Mode.Boutique@gmail.co</a>
                    </div>
                </div>
            </div>
        </footer>
    )
}

export default Footer;
